import {  useState } from "react"
import { useDispatch } from "react-redux"
import { Flogin } from "../Action/LoginuserAction"
import style from'../Page/Login.module.css'
import clsx from'clsx'

function Login(){
    const dispatch=useDispatch()

    const[taikhoan,Settaikhoan]=useState('')
    const[matkhau,Setmatkhau]=useState('')

    const handle=()=>{
        // const action=Flogin(loginset)
        dispatch(Flogin(taikhoan, matkhau))
    }
 return(
    <div>
        <input type="text"
        value={taikhoan}
        onChange={e=>Settaikhoan(e.target.value)}
        className={clsx(style.style)} />
        <br />
        <input type="password"
        value={matkhau}
        onChange={e=>Setmatkhau(e.target.value)} />
        <br />
        <button className={clsx(style.ibli)} onClick={handle}>dang nhap</button>

    </div>
 )   
}

export default Login
